var _default = {
  data: function data() {
    return {
      show: false,
      shop: [],
      url1: 'http://waimai.com',
      length: '',
      zongshu: '',
      delivery_price: '',
      box_price: '',
      shanjia_name: '',
      address: '',
      address_name: '',
      address_phone: '',
      gender: '',
      address_id: '',
      remake: '',
      couponList: [],
      select: '请选择',
      manyprice: ''
    };
  },
  // computed: {
  // 	newArr: function() {
  // 		return JSON.parse(JSON.stringify(this.couponList))
  // 	}
  // },
  // watch:{
  // 	newArr: {
  // 		handler: function(val, oldval){
  // 			console.log(val, oldval)
  // 		},
  // 		deep: true
  // 	}
  // },
  onLoad: function onLoad(options) {
    var _this = this;
    this.length = JSON.parse(Object.values(options)).length;
    this.shop = JSON.parse(Object.values(options));
    this.manyprice = this.zongshu = uni.getStorageSync('total');
    this.delivery_price = JSON.parse(Object.values(options))[0].delivery_price;
    this.shanjia_name = JSON.parse(Object.values(options))[0].shanjia_name;
    this.box_price = JSON.parse(Object.values(options))[0].box_price;
    uni.setStorageSync('shanjia_name', JSON.parse(Object.values(options))[0].shanjia_name);
    // 默认地址
    uni.$u.http.post('api/users/getuseraddresslist', {
      user_id: uni.getStorageSync('user').user_id
    }).then(function (res) {
      for (var index in res.data.data) {
        if (res.data.data[index].is_default == 1) {
          _this.address = res.data.data[index].delivery_address;
          _this.address_name = res.data.data[index].delivery_name;
          _this.address_phone = res.data.data[index].delivery_phone;
          _this.gender = res.data.data[index].gender;
          _this.address_id = res.data.data[index].address_id;
          return;
        } else {
          _this.address = '请选择一个地址';
        }
      }
    });
    // 获取优惠卷
    uni.$u.http.post('api/users/getusercunponlist', {
      user_id: uni.getStorageSync('user').user_id,
      campus_id: uni.getStorageSync('campus_id')
    }).then(function (res) {
      // console.log(res)
      var checked = {
        checked: false
      };
      res.data.data.forEach(function (el) {
        Object.assign(el, checked);
      });
      // 判断是否总金额是否达标满减要求
      res.data.data.forEach(function (el) {
        if (_this.zongshu >= parseInt(el.full_money)) {
          _this.couponList.push(el);
        }
      });
    }).catch(function (err) {
      console.log('400', err);
      uni.showToast({
        title: '获取优惠卷接口出错',
        icon: 'none'
      });
    });
    // 获取月卡
    uni.$u.http.post('api/orders/wxpay_card', {
      user_id: uni.getStorageSync('user').user_id
    }).then(function (res) {
      // console.log(res)
    }).catch(function (err) {
      console.log('400', err);
      uni.showToast({
        title: '获取月卡接口出错',
        icon: 'none'
      });
    });
  },
  methods: {
    checkboxChange: function checkboxChange(e) {
      // console.log(e)
      this.select = e.discount_money;
      this.manyprice = this.zongshu - e.discount_money;
      this.show = false;
      this.use_coupon = e.id;
      this.couponList.forEach(function (el) {
        if (e.id === el.id) {
          el.checked = true;
        } else {
          el.checked = false;
        }
      });
    },
    //接收地址
    otherFun: function otherFun(object) {
      if (!!object) {
        this.address = object.delivery_address;
        this.address_name = object.delivery_name;
        this.address_phone = object.delivery_phone;
        this.address_id = object.address_id;
      }
    },
    close: function close() {
      this.show = false;
    },
    // 提交订单
    submit: function submit() {
      if (!this.address_id) {
        uni.showToast({
          title: '请选择地址',
          icon: 'none'
        });
        return;
      }
      var goods_id = [];
      var goods_num = [];
      this.shop.forEach(function (item, index) {
        if (item.goods_num != 0) {
          goods_id.push(item.goods_id + ':' + (item.id ? item.id : ''));
          goods_num.push(item.goods_num);
        } else {
          goods_id.splice(index, item.goods_id);
          goods_num.splice(index, item.goods_num);
        }
      });
      // 商家订单接口
      uni.$u.http.post('api/orders/wxpay_digital_good', {
        user_id: uni.getStorageSync('user').user_id,
        buy_goods: goods_id.toString(),
        buy_number: goods_num.toString(),
        address_id: this.address_id,
        use_coupon: this.use_coupon,
        store_id: uni.getStorageSync('store_id'),
        remake: this.remake //备注
      }).then(function (res) {
        uni.setStorageSync('order_number', res.data.data.order_number);
        uni.requestPayment({
          provider: 'wxpay',
          timeStamp: res.data.data.timeStamp,
          nonceStr: res.data.data.nonceStr,
          package: res.data.data.package,
          signType: res.data.data.signType,
          paySign: res.data.data.paySign,
          success: function success(ress) {
            uni.redirectTo({
              url: './dingdantijiao'
            });
          },
          fail: function fail(err) {
            uni.redirectTo({
              url: './dingdantijiao'
            });
          }
        });
      }).catch(function (err) {
        console.log('400', err);
        uni.showToast({
          title: '商家订单接口出错',
          icon: 'none'
        });
      });
    },
    // 返回商家
    on_page: function on_page() {
      uni.navigateBack({
        delta: 1
      });
    }
  }
};
